import React from 'react';

const Card = () => {
  return (
  	<div className>
	    <div>
			<div class="tc mw5 center bg-green br3 pa3 pa4-ns mv3 b--black-10 grow bw2 shadow">
			    <img alt='robots' src='https://robohash.org/test?size=200x200' class="br-100 h4 w4 dib ba b--black-05 pa2" />
			    <h1 class="f3 mb2">John Doe</h1>
			    <h2 class="f5 fw4 white mt0">john.doe@gmail.com</h2>
			 </div>
	    </div>
  	</div>
  );
}

export default Card;
